                <input type="text" name="phoneNumber" placeholder="phone number"/>

                <label for="access-code">Access Code</label>
                <input type="text" name="accessCode" placeholder="access code"/>

                <input type="submit" value="submit"/>
            </form>
        </div>
    )


}

